import { useState, useEffect } from "react";
import Content from "./Content";

const moviesList = [
  {
    name: "Curious case of benjamin button",
    image: "../images/movies/Curious case of benjamin button.jpg",
    date: "February 18, 2009",
    description:
      "Benjamin Button, born in 1918 with the physical state of an elderly man, ages in reverse. He experiences love and break-ups, ecstasy and sorrow, and timelessness by the time he died in 2003 as a baby.",
  },

  {},
];

export default function Movies() {
  useEffect(() => {
    document.getElementById(
      "body"
    ).style.backgroundImage = `url("../images/movieback.jpg")`;
  });

  return (
    <div className="movies">
      <Content data={moviesList} />
    </div>
  );
}
